import React from 'react'
import AllPosts from './AllPosts'
import Carousel from 'react-bootstrap/Carousel';

const Welcome = (props) => {
  return (
    <div><h4>Trek To Tech: About us</h4>

    <p>Tech, the final frontier. These are the blog posts of Lakshmi, Rachel, Geetha and Margaret.
    Their continuing mission: to explore strange new syntax, to seek out networks and cloud based environments,
    to boldly code like they have never coded before... </p>
    </div>


  )
}

export default Welcome
